const LogoTicker1 = () => {
  return (
    <div className="logo-ticker2">
      <div className="trusted-by-the-worlds-most-in-container">
        <div className="trusted-by-the2">
         <p>Trusted by the worldâ€™s most </p> 
          <p> innovative teams </p>
        </div>
        <div className="acme-1-container">
          <div className="a">
          <img className="acme-1-icon2" alt="" src="/acme-1@2x.png" />
          <img className="quantum-1-icon2" alt="" src="/quantum-1@2x.png" />
          <img className="echo-1-icon2" alt="" src="/echo-1@2x.png" />
          </div>
          <div className="b">
          <img className="celestia-1-icon2" alt="" src="/celestia-1@2x.png" />
          <img className="pulse-1-icon2" alt="" src="/pulse-1@2x.png" />
          <img className="apex-1-icon2" alt="" src="/apex-1@2x.png" />
        </div>
        </div>
      </div>
    </div>
  );
};

export default LogoTicker1;
